{"query":"query getCandlesticks($timeFrom: TimestampU64, $timeTo: TimestampU64, $resolution: Resolution!, $pool: Address!) {
  candlesticks(
    timeFrom: $timeFrom
    timeTo: $timeTo
    resolution: $resolution
    pool: $pool
  ) {
    data {
      open
      low
      high
      close
      time
      __typename
    }
    __typename
  }
}
